     console.log(collectedData);
    setAddedData((prevState) => { return [collectedData, ...prevState ] });
    console.log(collectedData.date.get);
  };


  return (
    <div>
      <NewExpense onAddNewExpenseHandler={colectedDataHandler} />
      <Expenses items={addedData}  />
    </div>
  );
}

export default App;
